import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import '../styles/emotionsDiary.css';

function EmotionDiary() {
  const navigate = useNavigate();
  const [timeMachineResult, setTimeMachineResult] = useState(null);
  const [ratings, setRatings] = useState({}); // { activityInstanceId: 'feliz', ... }
  const [loading, setLoading] = useState(true);
  const emotionLevels = ['muy feliz', 'feliz', 'neutral', 'poco feliz', 'nada feliz'];

  // Cargar el último resultado de la Máquina del Tiempo para el usuario
  useEffect(() => {
    const fetchResult = async () => {
      try {
        const token = localStorage.getItem('token');
        if (!token) {
          navigate('/');
          return;
        }
        const res = await axios.get('http://localhost:5000/api/game', {
          headers: { 'x-auth-token': token }
        });
        // Suponemos que res.data es un array ordenado por createdAt descendente
        if (res.data.length > 0) {
          setTimeMachineResult(res.data[0]);
        }
      } catch (err) {
        console.error(err);
      } finally {
        setLoading(false);
      }
    };
    fetchResult();
  }, [navigate]);

  // Actualizar el rating para una actividad
  const handleRatingChange = (activityInstanceId, level) => {
    setRatings(prev => ({
      ...prev,
      [activityInstanceId]: level
    }));
  };

  // Guardar la valoración del diario
  const handleSaveDiary = async () => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/');
      return;
    }
    if (!timeMachineResult) {
      alert('No hay datos de la Máquina del Tiempo.');
      return;
    }
    // Construir el payload: relacionamos cada actividad con el rating seleccionado
    const payload = {
      timeMachineResult: timeMachineResult._id,
      ratings: []
    };
    // Recorrer cada franja horaria
    timeMachineResult.timeSlots.forEach(slot => {
      // Para cada actividad, si tiene rating asignado, se incluye en el payload
      slot.activities.forEach(act => {
        const rating = ratings[act.instanceId];
        if (rating) {
          payload.ratings.push({
            activityId: act.activityId || act.id,
            rating
          });
        }
      });
    });

    try {
      await axios.post('http://localhost:5000/api/emotion-diary', payload, {
        headers: { 'x-auth-token': token }
      });
      alert('¡Tu diario ha sido guardado!');
      navigate('/dashboard');
    } catch (err) {
      console.error(err);
      alert('Error al guardar el diario.');
    }
  };

  if (loading) return <p>Cargando datos...</p>;
  if (!timeMachineResult)
    return <p>No se encontraron datos de la Máquina del Tiempo. Regresa a registrar tu día.</p>;

  return (
    <div className="emotion-diary-container">
      <header className="ed-header">
        <button className="back-dashboard-btn" onClick={() => navigate('/dashboard')}>←</button>
        <h1>Diario de emociones</h1>
      </header>
      
      <div className="ed-instructions">
        <p>¿Cómo te sientes con lo bien que haces estas actividades?</p>
      </div>

      <div className="ed-diary">
        {timeMachineResult.timeSlots.map(slot => (
          <div key={slot.slot} className="ed-slot">
            <h3>{slot.slot}</h3>
            <div className="ed-activities">
              {slot.activities.map(act => (
                <div key={act.instanceId} className="ed-activity-card">
                  <div className="ed-activity-info">
                    <span className="ed-activity-icon">{act.icon}</span>
                    <span className="ed-activity-title">{act.title}</span>
                  </div>
                  <div className="ed-emotion-selector">
                    {emotionLevels.map(level => (
                      <button
                        key={level}
                        className={`emotion-btn ${ratings[act.instanceId] === level ? 'selected' : ''}`}
                        onClick={() => handleRatingChange(act.instanceId, level)}
                      >
                        {level}
                      </button>
                    ))}
                  </div>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>

      <div className="ed-actions">
        <button className="ed-save-btn" onClick={handleSaveDiary}>
          Guardar mi diario
        </button>
      </div>

      <footer className="ed-footer">
        <p>2025 © Iván Vela Campos</p>
      </footer>
    </div>
  );
}

export default EmotionDiary;
